// import { useState, useEffect } from 'react'
import './App.css';


function getExp(stlvl,endlvl,type){
  fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {

  return (
    <div className="App">

      <input type="number" id="stlvl"></input>
      <input type="number" id="endlvl"></input>
      <button onClick={getExp(document.getElementById('stlvl'),document.getElementById('endlvl'),"none")}> Get Exp </button>
    </div>
  );
}

export default App;
